import React from 'react';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

export default function AddCommessa() {

  const [selectedDate, setSelectedDate] = useState(null);

  const handleDateChange = (date) => {
    setSelectedDate(date);
  };

  return (
    <div className="container">
    
        <div className="row">
            <div className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow">
                <h2 className="text-center m-4">Add Commessa Form</h2>
                <div className="mb-3">
                    <label htmlFor="Title" className="form-tabel">
                        Title
                    </label>
                    <input 
                    type={"text"}
                    className="form-control"
                    name="title" />
                </div>
                <div className="mb-3">
                    <label htmlFor="Description" className="form-tabel">
                        Description
                    </label>
                    <input 
                    type={"text"}
                    className="form-control"
                    name="description" />
                </div>
                <div className="mb-3">
                    <label htmlFor="Note" className="form-tabel">
                        Note
                    </label>
                    <input 
                    type={"text"}
                    className="form-control"
                    name="Note" />
                </div>
                <div className="mb-3">
                <label htmlFor="Date" className="form-tabel">
                Date
                </label>
                <br />
                <DatePicker
                selected={selectedDate}
                onChange={handleDateChange}
                className="form-control"
                dateFormat="dd/MM/yyyy"
                name="date"
                />
          </div>
                <button type="submit" className="btn btn-outline-primary">Sumbit</button>
                <Link className="btn btn-outline-danger mx-2" type="submit" to="/">Cancel</Link>
            </div>
        </div>
    
    </div>
  )
}
